// LeftSideProfile.js

import React from 'react';
import ReactTypingEffect from 'react-typing-effect'; 
import picture1 from './han.jpeg';
import tistoryLogo from './tistory-logo.png';

function ProfileSidebar() {
  return (
    <div style={{ flex: '1' }}> {/* Left side content */}
      <div 
        style={{ 
          display: 'flex', 
          justifyContent: 'center', 
          alignItems: 'center', 
          flexDirection: 'column', 
          marginTop: '50px' 
        }}
      >
        {/* 프로필 사진 */}
        <img 
          src={picture1} 
          width='200px' 
          alt="Profile of Han Jang" 
          style={{ marginBottom: '1rem' }}
        />

        {/* 이름, 간단 라벨 */}
        <h2 style={{ marginBottom: '0.5em' }}>Han Jang</h2>
        <p style={{ fontWeight: 'bold', fontStyle: 'italic' }}>
          Senior Student
        </p>
        <p 
          style={{ 
            textAlign: 'center', 
            margin: '0 0 10px 0', 
            fontWeight: 'normal', 
            fontStyle: 'italic' 
          }}
        >
          {/* 요청하신 Summary 문구 */}
          Passionate about bridging AI and healthcare to improve human well-being.
        </p>

        {/* 관심 분야 (타이핑 효과) */}
        <p 
          style={{ 
            textAlign: 'center', 
            margin: '0 0 20px 0', 
            fontWeight: 'normal' 
          }}
        >
          I'm interested in&nbsp;
          <ReactTypingEffect 
            text={[
              "Deep Learning.", 
              "Machine Learning.", 
              "Medical Imaging.", 
              "Generative Models.",
              "Neuroimaging.", 
              "Neuroscience."
            ]}
            speed={50}         
            eraseSpeed={50}     
            eraseDelay={1000}   
            typingDelay={500}   
            cursor="|"          
          />
        </p>

        {/* 하단 정보 목록 (위치, 이메일, GitHub 등) */}
        <div 
          style={{ 
            display: 'flex', 
            flexDirection: 'column', 
            alignItems: 'flex-start', 
            fontSize: '12px' 
          }}
        >
          {/* 위치 */}
          <p style={{ margin: '5px 0' }}>
            <i className="fas fa-map-marker-alt"></i> &nbsp; 
            San Diego, California, United States
          </p>

          {/* 이메일 추가 */}
          <p style={{ margin: '5px 0' }}>
            <i className="fas fa-envelope"></i> &nbsp; 
            janghan001112[at]gmail[dot]com
          </p>

          {/* GitHub */}
          <p style={{ margin: '5px 0' }}>
            <i className="fab fa-github" style={{ marginRight: '3px' }}></i> &nbsp;
            <a 
              href="https://github.com/janghana" 
              target="_blank" 
              rel="noopener noreferrer" 
              className="advisor-link"
            >
              GitHub
            </a>
          </p>

          {/* LinkedIn */}
          <p style={{ margin: '5px 0' }}>
            <i className="fab fa-linkedin" style={{ marginRight: '10px' }}></i> 
            <a 
              href="https://www.linkedin.com/in/han-jang-255aa0253/" 
              target="_blank" 
              rel="noopener noreferrer" 
              className="advisor-link"
            >
              Linkedin
            </a>
          </p>

          {/* Tistory */}
          <p style={{ margin: '5px 0' }}> 
            <img 
              src={tistoryLogo} 
              alt="Tistory Logo" 
              style={{ width: '10px', height: '10px', marginRight: '10px' }}
            />
            <a 
              href="https://janghan-kor.tistory.com/" 
              target="_blank" 
              rel="noopener noreferrer" 
              className="advisor-link"
            >
              Tistory
            </a>
          </p>

          {/* Google Scholar */}
          <p style={{ margin: '5px 0' }}>
            <i className="fas fa-graduation-cap"></i> &nbsp;
            <a 
              href="https://scholar.google.com/citations?hl=en&user=b6IRRlsAAAAJ" 
              target="_blank" 
              rel="noopener noreferrer" 
              className="advisor-link"
            >
              Google Scholar
            </a>
          </p>
        </div>
      </div>
    </div>
  );
}

export default ProfileSidebar;
